###
Problem: If $\det \mathbf{A} = 2$ and $\det \mathbf{B} = 12,$ then find $\det (\mathbf{A} \mathbf{B}).$
Answer: We have that $\det (\mathbf{A} \mathbf{B}) = (\det \mathbf{A})(\det \mathbf{B}) = (2)(12) = \boxed{24}.$
###
Problem: Simplify $\frac{\csc \theta}{\sin \theta} - \frac{\cot \theta}{\tan \theta}.$
Answer: We have that
\begin{align*}
\frac{\csc \theta}{\sin \theta} - \frac{\cot \theta}{\tan \theta} &= \frac{1/\sin \theta}{\sin \theta} - \frac{\cos \theta/\sin \theta}{\sin \theta/\cos \theta} \\
&= \frac{1}{\sin^2 \theta} - \frac{\cos^2 \theta}{\sin^2 \theta} \\
&= \frac{1 - \cos^2 \theta}{\sin^2 \theta} = \frac{\sin^2 \theta}{\sin^2 \theta} = \boxed{1}.
\end{align*}
