Problem: Compute $\tan \left (\operatorname{arccot} \frac{4}{7} \right).$
Answer: Consider a right triangle where the adjacent side is 4 and the opposite side is 7.

[asy]
unitsize (0.5 cm);

draw((0,0)--(4,0)--(4,7)--cycle);

label("$4$", (2,0), S);
label("$7$", (4,7/2), E);
label("$\theta$", (0.8,0.5));
[/asy]

Then $\cot \theta = \frac{4}{7},$ so $\theta = \operatorname{arccot} \frac{4}{7}.$  Hence, $\tan \theta = \frac{1}{\cot \theta} = \boxed{\frac{7}{4}}.$
###
Problem: Compute $\operatorname{arccot} (-1).$  Express your answer in radians.
Answer: Since $\cot \left( \frac{3 \pi}{4} \right) = -1,$ $\operatorname{arccot} (-1) = \boxed{\frac{3 \pi}{4}}.$

Note: The arccot function is somewhat controversial.  Some define the range of the arccot function as $(0,\pi)$ (including the AoPS Precalculus textbook), and others define the range as $\left( -\frac{\pi}{2}, 0 \right) \cup \left( 0, \frac{\pi}{2} \right].$
###
Problem: Find the phase shift of the graph of $y =  3 \sin \left( x - \frac{\pi}{5} \right).$
Answer: Since the graph of $y = 3 \sin \left( x - \frac{\pi}{5} \right)$ is the same as the graph of $y = 3 \sin x$ shifted $\frac{\pi}{5}$ units to the right, the phase shift is $\boxed{\frac{\pi}{5}}.$

